caption.text:
Kami memang jauh dari tanah air tercinta, tapi justru dari sana kami belajar untuk melestarikan dan meghargai setiap perbedaan budaya yang ada di tanah air tercinta. 
Karena disetiap kesatuan terdiri dari banyak perbedaan. 
